export default function msToTime(s) {
    const ms = s % 1000;
    s = (s - ms) / 1000;
    const secs = ((s % 60) / 10) ;
    s = (s - secs) / 60;
    const mins = s % 60;
    return (mins + ':' + secs + '.' + ms);
}
